!function(){function e(e,s){return e.write('<div class="search-results-container"><div class="searching" id="searching"><div class="wait-indicator-icon"></div> Searching...</div><div id="resultsContainer"><div class="hd"><span class="count"><span id="count">').reference(s.get(["totalCount"],!1),s,"h").write('</span> results</span><div class="view-modifiers"><div class="view-select">View: <div class="view-icon view-icon-selected" id="viewIconGallery"><i class="icon-th"></i></div><div class="view-icon" id="viewIconList"><i class="icon-th-list"></i></div></div></div></div><div id="resultsTarget"><div class="search-results view-').reference(s.get(["view"],!1),s,"h").write('">').section(s.get(["searchRecords"],!1),s,{block:i},null).write("</div></div></div></div>")}function i(e,i){return e.write('<div class="search-item"><div class="search-item-container drop-shadow"><div class="img-container"><img src="').reference(i.get(["imgUrl"],!1),i,"h").write('"></div><h4 class="title"><a href="').reference(i.get(["viewItemUrl"],!1),i,"h").write('">').reference(i.get(["title"],!1),i,"h").write("</a></h4>").reference(i.get(["description"],!1),i,"h").exists(i.get(["featured"],!1),i,{block:s},null).exists(i.get(["sizes"],!1),i,{block:t},null).write("</div></div>")}function s(e){return e.write("<div>Featured!</div>")}function t(e,i){return e.write("<div>Sizes available:<ul>").section(i.get(["sizes"],!1),i,{block:r},null).write("</ul></div>")}function r(e,i){return e.write("<li>").reference(i.getPath(!0,[]),i,"h").write("</li>")}return dust.register("search-results",e),e}();